import React from 'react';
import "./App.css";

const PaginationComponent = (props) => {
    console.log(props)
    return(
        <div className="page-buttons">
            <button onClick={()=>props.changePage(1)} className="page-button">{props.currentpage-1}</button>
            <button onClick={()=>props.changePage(props.currentpage>1 ? props.currentpage - 1 : 1)} className="page-button">Previous</button>
            {/* <button onClick={()=>props.changePage(1)} className="page-button">1</button> */}
            <button onClick={()=>props.changePage(2)} className="page-button">{props.currentpage-1}</button>
            <button onClick={()=>props.changePage(3)} className="page-button">{props.currentpage}</button>
            <button onClick={()=>props.changePage(4)} className="page-button">{props.currentpage+1}</button>
            {/* <button onClick={()=>props.changePage(5)} className="page-button">5</button> */}
            <button onClick={()=>props.changePage(props.currentpage<500 ? props.currentpage + 1 : 500)} className="page-button">Next</button>
        </div>
    );
}
export default PaginationComponent;
